export class DataGridWithText extends DataGrid {
  constructor(text, x, y, w, h) {
    super(x, y, w, h); // Call super before this
    this.text = text;
  }
}

export class DataGridWithTextAndImage extends DataGrid {
  constructor(text, image, alt, x, y, w, h) {
    super(x, y, w, h); // Call super before this
    this.text = text;
    this.image = image;
    this.alt = alt;
  }
}

export class DataGridWithImage extends DataGrid {
  constructor(image, alt, x, y, w, h) {
    super(x, y, w, h); // Call super before this
    this.image = image;
    this.alt = alt;
  }
}

export class DataGridWithTextAndTitle extends DataGrid {
  constructor(text, title, x, y, w, h) {
    super(x, y, w, h); // Call super before this
    this.text = text;
    this.title = title;
  }
}

export class DataGridWithImageAndUrl extends DataGrid {
  constructor(url, image, alt, x, y, w, h) {
    super(x, y, w, h); // Call super before this
    this.url = url;
    this.image = image;
    this.alt = alt;
  }
}

class DataGrid {
  constructor(x, y, w, h) {
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
  }
}
